import React from 'react'
import { StyleSheet } from 'react-native'
import Center from './Center';

const StyleCentre = StyleSheet.create({
    
    conteiner:{
        display:'flex',
        alignItems:'center'
    },
    
    imgStyle :{
        margin:'5%',
        height:"20%",
        width:"w0%",
        borderRadius:10000000
    }
});

export default StyleCentre;
